import "./App.css";
import React, { Component } from "react";

import axios from "axios";

class GamesList extends Component {
  constructor() {
    super();
    this.state = {
      socapi: []
    };
  }

  componentDidMount() {
    axios.get(`https://888c3073.ngrok.io/socapi/`).then(response => {
      this.setState({
        socapi: response.data
      });
    });
  }

  render() {
    const { socapi } = this.state;
    return (
      <ul>
        {socapi.map(socapi => (
          <li>{socapi.id}</li>
        ))}
      </ul>
    );
  }
}
export default GamesList;
